// frontend/src/components/Benefits.js
import React from 'react';

const Benefits = () => {
  return (
    <div className="benefits">
      <h2>Benefits of Gita</h2>
      <p>
        Real life examples and implementations of Bhagavad Gita... (Fill example texts)
      </p>
      <div className="video-container">
        <iframe
          width="560"
          height="315"
          src="https://www.youtube.com/embed/your_benefits_video_id"
          title="YouTube video player"
          frameBorder="0"
          allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
          allowFullScreen
        ></iframe>
      </div>
      <div className="images">
        <img src="/images/krishna1.jpg" alt="Lord Krishna" width="200" />
        <img src="/images/krishna2.jpg" alt="Lord Krishna" width="200" />
        <img src="/images/krishna3.jpg" alt="Lord Krishna" width="200" />
      </div>
    </div>
  );
};

export default Benefits;
